var buf = []

var an1 = 0
var an2 = 0
const radx = 80
const rady = 30

function TIC () {
  flushBuffer(120 + Math.cos(an1)*radx,
    68 + Math.sin(an2)*rady,
    30, 30, -4, -4);
  an1 += 0.07;
  an2 += 0.13;
}

cls(0)
