map(0, 0, 30, 17, 0, 0, 1)


for (var y = 0; y < 136; y++) {
  for (var x = 0; x < 240; x++) {
    buf.push(pix(x, y))
  }
}

function getLensBufferPixel(x, y, lensX, lensY, lensW, lensH, shiftX, shiftY) {
  var nx = x;
  var ny = y;
  var xs = x - lensX;
  var ys = y - lensY;
  var rs = lensW*lensH;
  if (xs*xs + ys*ys < rs) {
    ny = y + shiftY;
    nx = x + shiftX;
  }
  return buf[nx + ny*240]
}


function flushBuffer(lensX, lensY, lensW, lensH, shiftX, shiftY) {
  for (var y = 0; y < 136; y++) {
    for (var x = 0; x < 240; x++) {
      const color = getLensBufferPixel(x, y, lensX, lensY,
        lensW, lensH, shiftX, shiftY);
      pix(x, y, color)
    }
  }
}

